import{_ as a,c as t,o as s,ag as o}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"DROP USER MAPPING","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_USER_MAPPING.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_USER_MAPPING.md"}'),i={name:"docs/7x/ref_guide/sql_commands/DROP_USER_MAPPING.md"};function r(n,e,p,d,c,l){return s(),t("div",null,e[0]||(e[0]=[o(`<h1 id="drop-user-mapping" tabindex="-1">DROP USER MAPPING <a class="header-anchor" href="#drop-user-mapping" aria-label="Permalink to &quot;DROP USER MAPPING&quot;">​</a></h1><p>Removes a user mapping for a foreign server.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP USER MAPPING [ IF EXISTS ] { &lt;user_name&gt; | USER | CURRENT_USER | PUBLIC } </span></span>
<span class="line"><span>    SERVER &lt;server_name&gt;</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP USER MAPPING</code> removes an existing user mapping from a foreign server.</p><p>The owner of a foreign server can drop user mappings for that server for any user. Also, a user can drop a user mapping for their own user name if they have been granted the <code>USAGE</code> privilege on the server.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the user mapping does not exist. WarehousePG issues a notice in this case.</p><p>user_name : User name of the mapping. <code>CURRENT_USER</code> and <code>USER</code> match the name of the current user. <code>PUBLIC</code> is used to match all present and future user names in the system.</p><p>server_name : Server name of the user mapping.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Drop the user mapping named <code>bob</code>, server <code>foo</code> if it exists:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP USER MAPPING IF EXISTS FOR bob SERVER foo;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>DROP SERVER</code> conforms to ISO/IEC 9075-9 (SQL/MED). The <code>IF EXISTS</code> clause is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_USER_MAPPING.html">CREATE USER MAPPING</a>, <a href="./ALTER_USER_MAPPING.html">ALTER USER MAPPING</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,19)]))}const u=a(i,[["render",r]]);export{m as __pageData,u as default};
